import Roster from "./Roster";

function RosterList({ rosters, user }) {
    const rosterFilter = rosters.map((roster) => {
        if (roster.coach_id === user) {
            return(
                <Roster
                    key={roster.id}
                    players={roster.players}
                    level={roster.level}
                    coach={roster.coach}
                    roster_size={roster.roster_size}
                    team={roster.team}
                />
            )
        }
    })
    return(
        rosterFilter
    )
}
export default RosterList;
